import React, {Fragment} from 'react';
import './App.css';
import Navbar from './Layout/Navbar';
import Banner from './Layout/Banner';
import {BrowserRouter as Router,Route,Switch} from 'react-router-dom';

function App() {
  return (
    <Router>
    <Fragment>
      <Navbar />
      <Route exact path='/' component={Banner} />

    </Fragment>
    </Router>
  );
}

export default App;
